import DataTable from 'react-data-table-component';

export default function DataList({ personalData }) {
    const columns = [
        {
            name: 'Name',
            selector: row => row.name,
        },
        {
            name: 'Surname',
            selector: row => row.surname,
        },
        {
            name: 'Birthday',
            selector: row => row.birthday,
        },
        {
            name: 'Birthplace',
            selector: row => row.birthplace,
        },
    ];


    return (
        <DataTable
            columns={columns}
            data={personalData}
        />
    );
}
